import React from 'react';
import { connect } from 'react-redux';
import { createStructuredSelector } from 'reselect';
import { selectDirectorySections } from '../../redux/directory/directory.selectors';
import { Link } from 'react-router-dom';

import MenuItem from '../menu-item/menu-item.component';

import './directory.styles.scss';

const Directory = ({ sections }) => {
	return (
		<>
			<header class="hero">
				<div class="container spacing slider">
					{/* <h1 class="primary-title">Momo & Brooklyn</h1>
					<h2>An Urban Living</h2>
					<Link to="/shop" class="btn">
						Shop Now
					</Link> */}

					<figure>
						<img
							src="https://images.unsplash.com/photo-1555041469-a586c61ea9bc?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1350&q=80"
							alt=""
						/>
						<img
							src="https://images.unsplash.com/photo-1567016432779-094069958ea5?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1400&q=80"
							alt=""
						/>
						<img
							src="https://images.unsplash.com/photo-1567016432779-094069958ea5?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1400&q=80"
							alt=""
						/>
						<img
							src="https://images.unsplash.com/photo-1515275844947-c28f9c617443?ixlib=rb-1.2.1&auto=format&fit=crop&w=1275&q=80"
							alt=""
						/>
						<img
							src="https://images.unsplash.com/photo-1501876725168-00c445821c9e?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80"
							alt=""
						/>
						<img
							src="https://images.unsplash.com/photo-1560449752-ac541afdd6b5?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80"
							alt=""
						/>
					</figure>
				</div>
			</header>
			<div class="shop-category">
				<div class="container">
					{/* <h2 class="section-title">Shop by Category</h2> */}

					<div className="directory-menu">
						{sections.map(({ id, ...otherSectionProps }) => {
							return <MenuItem key={id} {...otherSectionProps} />;
						})}
					</div>
				</div>
			</div>
		</>
	);
};

const mapStateToProps = createStructuredSelector({
	sections: selectDirectorySections,
});

export default connect(mapStateToProps)(Directory);
